import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (

    <div>
      <label>Enter feed url: </label>
      <form className="feed-url-form">
        <input type="text" name="feed-url">

        </input>
        <input type="submit" value="Submit"/>
      </form>
    </div>
  );
}

export default App;
